// useData.js
import { useEffect, useState } from 'react';
import data from './dataku.json'; // Import from src

export const useData = () => {
    const [dataState, setDataState] = useState([]);

    useEffect(() => {
        // Log imported data to verify format
        console.log("Raw Data:", data); // This will log your JSON data

        const processedData = data.map(d => ({
            Timestamp: new Date(d.Timestamp), // Convert to Date object
            HRV: +d.HRV // Ensure HRV is a number
        }));

        // Log processed data to ensure correctness
        console.log("Processed Data:", processedData);
        setDataState(processedData); // Set processed data for use
    }, []);

    return dataState; // Return the processed data
};
